const idleCallback=window.requestIdleCallback||window.requestAnimationFrame;function preload2(){const links=Array.prototype.slice.call(document.getElementsByTagName('a')||[]);links.map(l=>{l.addEventListener('mouseenter',function(ev){const link=this.href;if(!this.hasAttribute('preloaded')&&(link.startsWith("https://andrewconner.com")||link.startsWith("https://andrewconner.github.io")||link.startsWith("http://localhost"))){idleCallback(()=>{const prerenderLink=document.getElementById('prerenderLink');this.setAttribute('preloaded',1);if(prerenderLink){if(prerenderLink.href!==link)prerenderLink.href=link;;}else{var preloadLink=document.createElement('link');preloadLink.id="prerenderLink";preloadLink.rel="prefetch prerender";preloadLink.href=link;document.head.appendChild(preloadLink);}});}})});}
document.addEventListener('DOMContentLoaded',function(){idleCallback(preload2);});